import request from '@/utils/request'; //查询质检报工列表

export function queryRecords(query) {
  return request({
    url: '/mes/record/qualityInspection',
    method: 'get',
    params: query
  });
} // 创建质检报工

export function createRecords(data) {
  return request({
    url: '/mes/record/qualityInspection',
    method: 'post',
    data: data
  });
} // 不合格报工

export function unqualified(data) {
  return request({
    url: '/mes/record/qualityInspection/noQualified',
    method: 'patch',
    data: data
  });
} // 删除质检报工

export function deleteRecords(id) {
  return request({
    url: "/mes/record/qualityInspection/".concat(id),
    method: 'delete'
  });
} //不合格品及状态管理

export function patchRecords(id, methods) {
  return request({
    url: "/mes/record/qualityInspection/".concat(id, "/state?method=").concat(methods),
    method: 'patch'
  });
}
